import * as React from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import Container from '@mui/material/Container';
import Paper from '@mui/material/Paper';
import Button from '@mui/material/Button';

export default function ContactPage(){

return(
// dark mode form with first name, last name, email, message fields and a blue submit button

<div className="wrapper">
    <Container sx={
        {
          
          
            backgroundColor: '#1e1e1e',
            color: '#ffffff',
        }
    }>
        <Paper
          component="form"
          sx={{
            p: '4em',
            display: 'flex',
            flexDirection: 'column',
            gap: 1,
            alignItems: 'center',
            justifyContent: 'center',
    
            backgroundColor: '#333',
            color: '#ffffff',
    
          }}
          elevation={3}
        >
            <h1 style={{color: '#ffffff'}}>Contact Me</h1>
          <TextField
            sx={{ m: 1 }}
            id="outlined-basic"
            label="First Name"
            variant="filled"
            color="primary"
    
    
    
          />
          <TextField
            sx={{ m: 1, width: '25ch' }}
            id="outlined-basic"
            label="Last Name"
            variant="filled"
            color="primary"
          />
          <TextField
            sx={{ m: 1, width: '25ch' }}
            id="outlined-basic"
            label="Email"
            variant='filled'
            color="primary"
          />
          <TextField
            sx={{ m: 1 }}
            id="outlined-basic"
            label="Message"
            variant="filled"
            color="primary"
            multiline
          />
          <Button
            sx={{ m: 1, width: '25ch' }}
            variant="contained"
            color="primary"
          >
            Submit
          </Button>
        </Paper>
    </Container>
</div>

);
}
